// ConsoleWindow.js
import React, { useState } from 'react';

const ConsoleWindow = () => {
  const [consoleOutput, setConsoleOutput] = useState([]);

  const handleCommandSubmit = (command) => {
    // Process and handle the command here
    // You can update the consoleOutput state with the results
    // For this example, we'll just echo back the command
    setConsoleOutput([...consoleOutput, `> ${command}`]);
  };

  return (
    <div className='"fixed top-0 right-0 h-full w-1/4  p-4'>
      <div className="console-header">Portfolio Console</div>
      <div className="console-body">
        {consoleOutput.map((output, index) => (
          <div key={index} className="console-output">
            {output}
          </div>
        ))}
      </div>
      <div className="console-input">
        <input
          type="text"
          placeholder="Type a command..."
          onKeyDown={(e) => {
            if (e.key === 'Enter') {
              handleCommandSubmit(e.target.value);
              e.target.value = '';
            }
          }}
        />
      </div>
    </div>
  );
};

export default ConsoleWindow;
